import web from "../src/Images/web.jpg";
import app from "../src/Images/web.jpg";
import software from "../src/Images/software.jpg";
import digital from "../src/Images/digital.jpg";
import android from "../src/Images/web.jpg";
import marketing from "../src/Images/marketing.jpg";

const Sdata = [
  {
    imgSrc: web,
    title: "Web Development",
  },
  {
    imgSrc: app,
    title: "App Development",
  },
  {
    imgSrc: software,
    title: "Software Development",
  },
  {
    imgSrc: digital,
    title: "Digital Marketing",
  },
  {
    imgSrc: android,
    title: "Android Development",
  },
  {
    imgSrc: marketing,
    title: "Marketing Development",
  },
];

export default Sdata;
